import React from "react";

import { Tile } from "../tile/Tile";

export const TileList = ({ tiles }) => {
  if (!Array.isArray(tiles)) {
    return null; // or some fallback UI
  }

  return (
    <div>
      {tiles.map((tile, index) => {
        const { name, ...description } = tile;
        return (
          <Tile
            key={index}
            name={name}
            description={description}
          />
        );
      })}
    </div>
  );
};
